import React, { Component } from 'react'
import PropTypes from "prop-types";
import {Link} from "react-router-dom";
import isEmpty from "../../validation/is-empty";
import "./ItemStyles.css";

class ProfileItem extends Component {
  render() {

    const {profile} = this.props;

    return (
      <div>
        <div className = "row">
          <div >
            
          </div>
          <div >
          <Link to = {`/profile/${profile.handle}`} className = "link to dash">{profile.name}</Link>
            <h3>{profile.name}</h3>
            <p>
              <span>  {profile.sex},</span> 
              
              {isEmpty(profile.age) ? null : (<span> {profile.age}, </span>)}
              
              {isEmpty(profile.city) ? null : <span>{profile.city}</span>}
              {isEmpty(profile.state) ? null : <span>, {profile.state}</span>}
            </p>
            {/* <Link to = {`/profile/${profile.handle}`} className = "btn btn-info">view profile</Link> */}
          </div>
          
        </div>
        
      </div>
    )
  }
}

ProfileItem.propTypes = {
  profile: PropTypes.object.isRequired
}

export default ProfileItem;
